import React from 'react'


const Notifications = (props) => {
    const {notifications} = props;
    return(
        <div className="notification-title">
            <h2>Notifications</h2>
            <ul className="notifications">
                { notifications && notifications.map()}
            </ul>
        </div>
    )
}

export default Notifications;
